import React, { useState } from "react";
import IITILOGO from "./images/iitilogo.png";

export default function Left() {
  const [style, setStyle] = useState({
    marginTop:"2vh",
    textDecoration: "none",
    color: "black",

  });
  const [style4, setStyle4] = useState({
   marginTop:"2vh",
    textDecoration: "none",
    color: "black",

  });
  const [style1, setStyle1] = useState({
   marginTop:"2vh",
    textDecoration: "none",
    color: "black",
   

 
  });
  const [style2, setStyle2] = useState({
    marginTop:"2vh",
    textDecoration: "none",
    color: "black",
  });
  const [style3, setStyle3] = useState({
    marginTop:"2vh",
    textDecoration: "none",
    color: "black",
  });

  return (
    <>
      <div className="left d-flex" style={{borderCollapse:"collapse"}} >
        <div
          className="firstleft d-flex"
          style={{
            flexDirection: "column",
            height: "100vh",
            width: "4.5vh",
            backgroundColor: "rgb(59 99 139)",
            fontSize: "1.5rem",
            paddingLeft:"0.2rem",
            paddingTop:"0.4rem"
          }}
        >
          <a href="#" style={style4}
              onMouseEnter={() => {
                setStyle4({
                  color: "white",
                  backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle4({
                  color: "black",
                  marginTop:"2vh",
                  textDecoration: "none",
                });
              }}className="fontcolor-transparent">.</a>
           
          <a href="#"style={style}
              onMouseEnter={() => {
                setStyle({
                 color: "white",
                backgroundColor:"rgb(141 144 147 / 36%)",
                 textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle({
                  color: "black",
            marginTop:"2vh",
                  textDecoration: "none",
                });
              }}>
            <i
              class="fa-solid fa-qrcode"
              
            ></i>
          </a>
          <a href="#" style={style1}
              onMouseEnter={() => {
                setStyle1({
                  color: "white",
                  backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle1({
                  color: "black",
                 marginTop:"2vh",
                  textDecoration: "none",
                });
              }}>
            <i
              class="fa-regular fa-user"
             
            ></i>
          </a>
          <a href="#"style={style2}
              onMouseEnter={() => {
                setStyle2({
                  color: "white",
                   backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle2({
                  color: "black",
             marginTop:"2vh",
                  textDecoration: "none",
                });
              }}>
            <i
              class="fa-regular fa-user"
              
            ></i>
          </a>
          <a href="#"style={style3}
              onMouseEnter={() => {
                setStyle3({
                  color: "white",              
                  textDecoration: "none",
                   backgroundColor:"rgb(141 144 147 / 36%)",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle3({
                  color: "black",
marginTop:"2vh",
                  textDecoration: "none",
                });
              }}>
            <i
              class="fa-solid fa-table-cells"
              
            ></i>
          </a>
        </div>
        <div
          className="secondleft d-flex"
          style={{
            flexDirection: "column",           
            height: "100vh",
            width: "16vh",
            backgroundColor: "rgb(59 99 139)",
            position: "relative",
            fontSize: "1.5rem",
            paddingTop:"0.4rem"
          }}
        >
          <a
             href="#" className="pr-4"
            style={style4}
              onMouseEnter={() => {
                setStyle4({
                  color: "white",
               backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle4({
                  color: "black",
         marginTop:"2vh",
                  textDecoration: "none",
                });
              }}
          >
          <i class="fa-solid fa-angles-left"></i>
          </a>
          <a
            href="#"
            style={style}
              onMouseEnter={() => {
                setStyle({
                  color: "white",
               backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle({
                  color: "black",
         marginTop:"2vh",
                  textDecoration: "none",
                });
              }}
          >
            Dashboard
          </a>
          <a
            href="#"
            style={style1}
              onMouseEnter={() => {
                setStyle1({
                  color: "white",
                  backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle1({
                  color: "black",
          marginTop:"2vh",
                  textDecoration: "none",
                });
              }}
          >
            Profile
          </a>
          <a
            href="#"
            style={style2}
              onMouseEnter={() => {
                setStyle2({
                  color: "white",
                   backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle2({
                  color: "black",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
          >
            Enroll
          </a>
          <a
            href="#"
        // 
            style={style3}
              onMouseEnter={() => {
                setStyle3({
                  color: "white",
                 backgroundColor:"rgb(141 144 147 / 36%)",
                  textDecoration: "none",marginTop:"2vh",
                });
              }}
              onMouseLeave={() => {
                setStyle3({
                  color: "black",
            marginTop:"2vh",
                  textDecoration: "none",
                });
              }}
          >
            TimeTable
          </a>
          <div className="logo">
            <img
              src={IITILOGO}
              alt="logo"
              style={{ width: "5rem",bottom:"0px",position:"absolute" }}
            />
          </div>
        </div>
      </div>
    </>
  );
}
